@EU_Commission @jyrkikatainen @FedericaMog @eu_eeas @A_Breidthardt @MajaEUspox How I wrote already ... to shape Europe ...

I think, the blame for this Problems is here to find. 

I think the EMU should first focus on the own Economy, to make Jobs in the EMU, for building up the EMU, and now it is almost already 5 years to late. So the time running out.

@EU_Commission @MartinSelmayr Roy Jenkins' "European Diary" of his time as Commission president very useful on the gestation of this. 
1. Came to him as an idea during a picnic in Bois de la Cambre.
2. Sorted during a quick meeting in Bonn with Helmut Schmidt.

@EU_Commission I'm an European citizen, I pay my taxes, but my president, @KRLS, can't travel freely to Spain. He can move free all around Europe. Are you sure about what you say in your marketing?
I don't feel that those benefits belong to me.
Shame on @EU_Commission too
